$(document).ready(()=>{$(".progress-bar").css("width",model.xp/model.xpNeeded*100+"%");let n=new Vue({el:"#tabContent",data:{myQuizzes:{entries:[],pages:0,canEdit:!1},historyList:{entries:[],pages:0,showSummary:!1},myGroups:{entries:[],pages:0},myQuizzesClicked:!1,myGroupsClicked:!1},mounted:function(){this.historyListCallback(1);$("#myQuizzes-tab").click(()=>{this.myQuizzesClicked||(this.myQuizzesCallback(1),this.myQuizzesClicked=!0)});$("#myGroups-tab").click(()=>{this.myGroupsClicked||(this.myGroupsCallback(1),this.myGroupsClicked=!0)})},methods:{historyListCallback:function(n){let t=this;axios.get(util.apiUrl("/api/getQuizList",{page:n,size:global.quizCardAmount,type:"history",username:model.userName})).then(function(n){t.historyList.entries=n.data.entries;t.historyList.pages=n.data.pages;t.historyList.showSummary=n.data.showSummary})},myQuizzesCallback:function(n){let t=this;axios.get(util.apiUrl("/api/getQuizList",{page:n,size:global.quizCardAmount,type:"quizzesBy",username:model.userName})).then(function(n){t.myQuizzes.entries=n.data.entries;t.myQuizzes.pages=n.data.pages;t.myQuizzes.canEdit=n.data.canEdit})},myGroupsCallback:function(n){let t=this;axios.get(util.apiUrl("/api/group/getList/myGroups",{page:n,size:global.membersCardAmount,username:model.userName})).then(function(n){console.log(n.data);t.myGroups.entries=n.data.entries;t.myGroups.pages=n.data.pages}).catch(function(n){n.response.status===400&&util.openModal(n.response.data)})}}})});